import React from "react";
import Header from "./ModuleOneComponents/Header";
import Home from "./ModuleOneComponents/Home";
import Produtos from "./ModuleOneComponents/Produtos";

const App = () => {
  let Pagina = Home;

  const { pathname } = window.location;
  if (pathname === "/produto") {
    Pagina = Produtos;
  } else {
    Pagina = Home;
  }

  return (
    <>
      <Header />
      <Pagina />
    </>
  );
};

export default App;
